    - "Nyb\xC3\xB6rjar- och veteransimmare fj\xC3\xA4rilssimmar 300 meter."
    - "Vinterbadet i Tappstr\xC3\xB6mskanalen vid Eker\xC3\xB6 Centrum \xC3\xA4r en l\xC3\xA5ng tradition. Det finns k\xC3\xA4llor som antyder att man redan p\xC3\xA5 vikingatiden samlades vid Ica tappen drack mj\xC3\xB6d och gick ned till Seaside och badade.\r\n\
      \r\n\
      Simkunnigheten var ju inte d\xC3\xA5 vad den \xC3\xA4r nu. S\xC3\xA5 traditionen dog s\xC3\xA5 att s\xC3\xA4ga ut.\r\n\
      \r\n\
      Anm\xC3\xA4l dig genom att skicka ett meddelande i formul\xC3\xA4ret h\xC3\xA4r nere. Ber\xC3\xA4tta hur m\xC3\xA5nga som kommer."
