    - "Grankottar, tallkottar, alkottar. Men inte l\xC3\xB6nn\xC3\xA4sor."
    - "Kottarna plockas f\xC3\xB6r hand, med hj\xC3\xA4lp av skylift. Vi rensar kottarna, torkar dem och l\xC3\xA5ter sedan fr\xC3\xB6na eftermogna inomhus. \r\n\
      \r\n\
      D\xC3\xA4refter \xC3\xA4r det dags att f\xC3\xA5 fram fr\xC3\xB6na. Det kallas kl\xC3\xA4ngning och kottarna behandlas med v\xC3\xA4rme f\xC3\xB6r att \xC3\xB6ppna sig och sl\xC3\xA4ppa ifr\xC3\xA5n sig sina fr\xC3\xB6n. Fr\xC3\xB6na sorteras sedan efter storlek.\r\n\
