  - - 1
    - "Bollmora litter\xC3\xA4ra s\xC3\xA4llskap"
    - "Nobelpriset i litteratur utg\xC3\xA5r ur en fond som bildats av Alfred Nobels (1833\xE2\x80\x9396) efterl\xC3\xA4mnade f\xC3\xB6rm\xC3\xB6genhet och som f\xC3\xB6rvaltas av Nobelstiftelsen. Uppgiften att utse pristagare anf\xC3\xB6rtrodde Nobel i sitt testamente \xC3\xA5t Svenska Akademien. Det f\xC3\xB6rsta Nobelpriset utdelades 1901.\r\n\
      \r\n\
      Ber\xC3\xA4ttigade att f\xC3\xB6resl\xC3\xA5 pristagare \xC3\xA4r Akademiens ledam\xC3\xB6ter, ledam\xC3\xB6ter av andra akademier och samfund med likartade uppgifter, professorer i litter\xC3\xA4ra och spr\xC3\xA5kliga \xC3\xA4mnen, tidigare litter\xC3\xA4ra Nobelpristagare samt ordf\xC3\xB6rande i f\xC3\xB6rfattarorganisationer som \xC3\xA4r representativa f\xC3\xB6r sitt lands sk\xC3\xB6nlitter\xC3\xA4ra alstring.\r\n\
      \r\n\
      F\xC3\xB6rslag till \xC3\xA5rets pristagare skall ha inkommit skriftligen till Nobelkommitt\xC3\xA9n senast den 31 januari. F\xC3\xB6rslagsskrivelsen skall vara undertecknad av f\xC3\xB6rslagsst\xC3\xA4llaren och kan inte skickas via e-post. F\xC3\xB6rslaget b\xC3\xB6r, men m\xC3\xA5ste inte, \xC3\xA5tf\xC3\xB6ljas av en motivering. Det g\xC3\xA5r inte att f\xC3\xB6resl\xC3\xA5 sig sj\xC3\xA4lv som kandidat, dvs. Nobelpriset kan inte s\xC3\xB6kas. Varje \xC3\xA5r brukar det inkomma ungef\xC3\xA4r 350 f\xC3\xB6rslag.\r\n\
      \r\n\
      Under v\xC3\xA5ren bearbetas f\xC3\xB6rslagen av Nobelkommitt\xC3\xA9n. I april fastst\xC3\xA4ller Akademien en prelimin\xC3\xA4r kandidatlista omfattande 15-20 namn, och inf\xC3\xB6r Akademiens sommaruppeh\xC3\xA5ll brukar kandidatlistan vara reducerad till cirka fem namn.\r\n\
      \r\n\
      I oktober tr\xC3\xA4ffar Akademien sitt val. F\xC3\xB6r att valet skall vara giltigt kr\xC3\xA4vs att n\xC3\xA5gon kandidat f\xC3\xA5r mer \xC3\xA4n h\xC3\xA4lften av de avgivna r\xC3\xB6sterna.\r\n\
      \r\n\
      Pristagaren f\xC3\xA5r mottaga priset (10 milj. kr. 2007) av kungen i Stockholms konserthus p\xC3\xA5 Nobeldagen den 10 december. "
