    - Luruddens lurare
    - "LO bildades f\xC3\xB6r \xC3\xB6ver 100 \xC3\xA5r sedan som en landsomfattande sammanslutning av fackf\xC3\xB6reningar, i ett annat Sverige \xC3\xA4n det vi lever i idag. Tyv\xC3\xA4rr finns fortfarande behovet att k\xC3\xA4mpa mot or\xC3\xA4ttvisor som har sitt ursprung i vilken klass, vilket k\xC3\xB6n eller vilken etnicitet m\xC3\xA4nniskor har.\r\n\
      \r\n\
      LO \xC3\xA4r en samlande kraft f\xC3\xB6r 14 svenska fackf\xC3\xB6rbund. Medlemmar i f\xC3\xB6rbunden \xC3\xA4r undersk\xC3\xB6terskor, restaurangbitr\xC3\xA4den och mekaniker och m\xC3\xA5nga fler yrkesgrupper. Vi finns p\xC3\xA5 n\xC3\xA4stan varje arbetsplats i Sverige.\r\n\
      \r\n\
      LO \xC3\xA4r b\xC3\xA4rare av en id\xC3\xA9. Sluter vi oss samman blir vi starkare. D\xC3\xA5 kan inte arbetsgivaren bortse fr\xC3\xA5n v\xC3\xA5ra krav. V\xC3\xA5r id\xC3\xA9 \xC3\xA4r s\xC3\xA5 stark att mer \xC3\xA4n 1,6 miljoner arbetstagare i Sverige \xC3\xA4r medlemmar i n\xC3\xA5got av v\xC3\xA5ra f\xC3\xB6rbund.\r\n\
      \r\n\
      LO \xC3\xA4r en demokratisk feministisk organisation. LOs ledning och styrelse \xC3\xA4r valda av medlemmarna f\xC3\xB6r att leda LO. Kongressen \xC3\xA4r LOs h\xC3\xB6gsta beslutande organ. De beslut som kongressen fattar styr vad LO ska arbeta med. LOs ledning best\xC3\xA5r av tre personer som utses av LOs kongress. I ledningen ing\xC3\xA5r ordf\xC3\xB6rande, vice ordf\xC3\xB6rande och avtalssekreterare. N\xC3\xA4sta LO-kongress blir den 25-28 maj 2012.\r\n\
      \r\n\
      LOs centrala kansli ligger i Stockholm. D\xC3\xA4r jobbar 100 anst\xC3\xA4llda med bland annat opinionsbildning, organisationsfr\xC3\xA5gor och utredningsarbete. Det handlar om kollektivavtalens inneh\xC3\xA5ll, pensioner, avtalsf\xC3\xB6rs\xC3\xA4kringar, v\xC3\xA4lf\xC3\xA4rdsfr\xC3\xA5gor, ekonomisk politik, fackligt arbete, kursverksamhet och internationellt fackligt arbete.\r\n\
      \r\n\
      LO \xC3\xA4r organiserat i 13 regionala distrikt och i cirka 150 lokala LO-fack i kommunerna. Deras uppgift \xC3\xA4r att organisera den fackliga och politiska samverkan, driva arbetsmarknadspolitiska fr\xC3\xA5gor samt att arbeta med ungdoms- och skolverksamhet p\xC3\xA5 lokal och regional niv\xC3\xA5.\r\n"
